import React, { useState, useEffect } from "react";
import { Form, Button, Toast } from "react-bootstrap";
import LockIcon from "@material-ui/icons/Lock";
import MailOutlineIcon from "@material-ui/icons/MailOutline";
import axios from "axios";
import "../styles.css";

const ResetPassword = () => {
  const [formData, setFormData] = useState({
    newPassword: "",
    email: "",
    resetCode: "",
  });

  const [status, setStatus] = useState({ show: false, message: "", success: false });

  const handleChange = (e) =>
    setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!formData.email || !formData.code || !formData.newPassword) {
      setStatus({ show: true, message: "Please fill all fields", success: false });
      return;
    }

    try {
      const res = await axios.post(
        "http://localhost:5000/api/user/reset-password",
        formData,
        { headers: { "Content-Type": "application/json" } }
      );
      setStatus({ show: true, message: res.data.message, success: true });

      // إعادة التوجيه بعد 5 ثواني
      setTimeout(() => {
        window.location.href = "/auth";
      }, 5000);
    } catch (err) {
      const msg = err.response?.data?.message || "Something went wrong";
      setStatus({ show: true, message: msg, success: false });
    }
  };

  return (
    <div className="reset-password-container" style={{ marginTop: "5vh" }}>
      {status.show && (
        <Toast
          style={{
            position: "fixed",
            top: "20%",
            left: "50%",
            transform: "translateX(-50%)",
            zIndex: 9999,
            borderRadius: "1rem",
            minWidth: "300px",
          }}
          onClose={() => setStatus({ ...status, show: false })}
          autohide
          delay={4000}
        >
          <Toast.Header
            style={{
              backgroundColor: status.success ? "darkgreen" : "crimson",
              color: "white",
              fontWeight: "bold",
              borderTopLeftRadius: "1rem",
              borderTopRightRadius: "1rem",
            }}
          >
            {status.success ? "Success" : "Error"}
          </Toast.Header>
          <Toast.Body style={{ fontWeight: "500" }}>{status.message}</Toast.Body>
        </Toast>
      )}

      <h3 style={{ textAlign: "center", fontFamily: "Mulish" }}>
        Reset Your Password
      </h3>

      <Form onSubmit={handleSubmit} style={{ maxWidth: "400px", margin: "auto" }}>
        <Form.Group>
          <Form.Label>
            Email <MailOutlineIcon />
          </Form.Label>
          <Form.Control
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            placeholder="Enter your email"
          />
        </Form.Group>

        <Form.Group>
          <Form.Label>
            Verification Code <LockIcon />
          </Form.Label>
          <Form.Control
            type="text"
            name="code"
            value={formData.code}
            onChange={handleChange}
            placeholder="Enter the code you received"
          />
        </Form.Group>

        <Form.Group>
          <Form.Label>
            New Password <LockIcon />
          </Form.Label>
          <Form.Control
            type="password"
            name="newPassword"
            value={formData.newPassword}
            onChange={handleChange}
            placeholder="Enter new password"
          />
        </Form.Group>

        <Button
          type="submit"
          style={{
            width: "100%",
            borderRadius: "1rem",
            marginTop: "1rem",
            backgroundColor: "#007bff",
            border: "none",
          }}
        >
          Reset Password
        </Button>
      </Form>
    </div>
  );
};

export default ResetPassword;
